        "loremIpsumIsSimplyDummyTextOfThePrinting":
            MessageLookupByLibrary.simpleMessage(
                "লোরেম ইপসাম হল মুদ্রণ এবং টাইপসেটিং শিল্পের জন্য সহজে ব্যবহৃত একটি ডামি টেক্সট। লোরেম ইপসাম বহুদিন ধরে শিল্পের আদর্শ ডামি টেক্সট হিসাবে ব্যবহৃত হয়ে আসছে।"),
        "loremIpsumIsSimplyDummyTextOfThePrintingAndTypesettingIndustry":
            MessageLookupByLibrary.simpleMessage(
                "লোরেম ইপসাম মুদ্রণ এবং টাইপসেটিং শিল্পের জন্য কেবল ডামি টেক্সট। ১৫০০-এর দশক থেকে লোরেম ইপসাম শিল্পের মানসম্মত ডামি টেক্সট হিসেবে ব্যবহৃত হয়ে আসছে, যখন এক অজানা প্রিন্টার টাইপের একটি গ্যালি নিয়ে এটিকে একটি টাইপ নমুনা বই তৈরি করার জন্য স্ক্র্যাম্বল করেন। এটি পাঁচ শতাব্দী ধরে টিকে আছে এবং ইলেকট্রনিক টাইপসেটিংয়ে রূপান্তরের মধ্য দিয়েও মূলত অপরিবর্তিত রয়েছে। ১৯৬০-এর দশকে লেট্রাসেট শীটের মাধ্যমে লোরেম ইপসাম জনপ্রিয় হয়, এবং সম্প্রতি ডেস্কটপ প্রকাশনা সফটওয়্যার যেমন অলডাস পেজমেকারের মতো সফটওয়্যারে লোরেম ইপসামের বিভিন্ন সংস্করণ অন্তর্ভুক্ত হয়েছে।"),
        "loremIpsumIsSimplyDummyTextOfThePrintingAndTypesettingIndustry2":
            MessageLookupByLibrary.simpleMessage(
                "লোরেম ইপসাম হল মুদ্রণ ও টাইপসেটিং শিল্পের সাদামাটা মিথ্যা লেখা। লোরেম ইপসাম ১৫০০ সালের পর থেকে শিল্পের মানদণ্ড হিসেবে পরিচিত, যখন অজানা একজন প্রিন্টার টাইপের একটি গ্যালি নিয়ে এটিকে একটি টাইপ নমুনা বইতে পরিবর্তন করেন। এটি কেবল পাঁচ শতকই নয়, বৈদ্যুতিন টাইপসেটিংয়ের যুগেও টিকে আছে, মূলত অপরিবর্তিত অবস্থায়। এটি ১৯৬০-এর দশকে লেট্রাসেট শীটের মাধ্যমে জনপ্রিয়তা পায়, যাতে লোরেম ইপসাম প্যাসেজ অন্তর্ভুক্ত ছিল, এবং পরবর্তীতে ডেস্কটপ প্রকাশনা সফ্টওয়্যার যেমন অ্যাল্ডাস পেজমেকার যার মধ্যে লোরেম ইপসামের সংস্করণ রয়েছে।\\nজনপ্রিয় বিশ্বাসের বিপরীতে, লোরেম ইপসাম কেবল এলোমেলো পাঠ নয়। এর শিকড় ৪৫ খ্রিস্টপূর্বের একটি ধ্রুপদী ল্যাটিন সাহিত্য থেকে এসেছে, যা এটিকে ২০০০ বছরেরও বেশি পুরানো করে তোলে। ভার্জিনিয়ার হ্যাম্পডেন-সিডনি কলেজের ল্যাটিন অধ্যাপক রিচার্ড ম্যাকক্লিনটক লোরেম ইপসামের একটি প্যাসেজ থেকে আরও একটি অস্পষ্ট ল্যাটিন শব্দ, কনসেকটেটার, খুঁজে বের করেছিলেন এবং উদ্ধৃতিগুলি পরীক্ষা করেছিলেন।\\nযারা আগ্রহী তাদের জন্য ১৫০০ সালের পর থেকে ব্যবহৃত লোরেম ইপসামের মানক অংশটি নিচে পুনরুত্পাদন করা হয়েছে। সিসেরোর \"ডি ফিনিবাস বোনোরুম এট মালোরুম\" এর ১.১০.৩২ এবং ১.১০.৩৩ অংশগুলি তাদের আসল মূল রূপে পুনরুত্পাদিত হয়েছে, সাথে ১৯১৪ সালের এইচ. র্যাকহামের ইংরেজি অনুবাদ।"),
